How to join multiple tables in mongodb<p>I currently have 5 tables that need to joined due to their coupling.
Using $lookup I can join the Order table with the Plan table and get what I need, but how do I go about the other tables?</p>

<p>Here is each table, and the Id/table it needs to connect with</p>

<pre><code>Plan       - _id, unassignedOrderIds(array)
DriverPlan - _id, planId, orderIds(array), driverId, vehicleId
Driver     - _id, vehicleId
Vehicle    - _id
Orders     - _id
</code></pre>

<p>In the end I'm looking for mongoDb to return a Plan object that has UnassignedOrders loaded and DriverPlans loaded. Followed by DriverPlans having its Orders,Driver, and Vehicle loaded.</p>

<p>Here is what I have so far:</p>

<pre><code>db.Plan.aggregate([
    // Unwind the source
    { "$unwind": "$UnassignedOrderIds" },
    // Do the lookup matching
    { "$lookup": {
       "from": "Order",
       "localField": "UnassignedOrderIds",
       "foreignField": "_id",
       "as": "UnassignedOrders"
    }},
    // Unwind the result arrays ( likely one or none )
    { "$unwind": "$UnassignedOrders" },
    // Group back to arrays
    { "$group": {
        "_id": "$_id",
        "Order": { "$push": "$Order" },
        "UnassignedOrders": { "$push": "$UnassignedOrders" }
    }}
])
</code></pre>

