Text search doesn't return anything for certain words<p>I have a database with an "entries" collection that is structured like so:</p>

<pre><code>{
    tags: [
        {
            type: mongoose.Schema.Types.ObjectId,
            ref: "Tag"
        }
    ],
    body: String
}
</code></pre>

<p>I wanted a search feature on my site, so I created a text index on the "body" property like this:</p>

<pre><code>db.entries.createIndex( { body: "text" } )
</code></pre>

<p>It worked fine. I created a couple of entries and ran <code>db.entries.find()</code>. I got this:</p>

<pre><code>{ "_id" : ObjectId("5c2e3d9fd1d5dd121ed85695"), "tags" : [ ], "body" : "some text", "__v" : 0 }
{ "_id" : ObjectId("5c2e3dadd1d5dd121ed85696"), "tags" : [ ], "body" : "text some", "__v" : 0 }
</code></pre>

<p>So far, so good. I search <code>db.entries.find({$text: { $search: "text" }})</code> and both of the entries are returned. But when I search <code>db.entries.find({$text: { $search: "some" }})</code> I get nothing. </p>

<p>I tried this again with different words. "church" works fine, but "more" doesn't return anything either. Why???</p>

