How to access/return values from mongo document with mongoose query and async-await/Promise?<p>I have used mongoDB but I am new to Node.js and mongoose and I am trying to get a grasp on using mongoose with async-await/Promises. I am creating an React/Node with web sockets (socket.io) app where users can create an account and log in if they already have an account. I have been able to successfully create and execute a mongo/mogoose query but I am having problems with using the document once I have it. This is what my code looks like:</p>

<pre><code>const profileRoute = (action, io) =&gt; {
    switch (action.cmd) {
        case 'LOGIN':
            getProfile(action.email)
                .then(profile =&gt; {
                    console.log('profile: ', profile)     // prints the mongo document properly.
                    console.log('email: ', profile.email) // email: undefined
                    io.emit('action', {
                        type: PROFILE_LOGIN,
                        email: profile.email,
                        name: profile.name,
                    });
                .catch(err =&gt; {console.log(err)});
            break;
        default:
            break;
    }
};
</code></pre>

<p>And this is what "getProfile()" looks like:</p>

<pre><code>export const getProfile = async (email) =&gt; {
    const tempPromise = collection.findOne({ email }).exec();
    try {
        return await tempPromise;
    } catch (err) {
        console.log(err);
        return {};
    } 
};
</code></pre>

<p>I have also tried to symplify "getProfile()" since async-await wouldn't help much here (just wanted to try something small to get started) to this:</p>

<pre><code>export const getProfile = (email) =&gt; {
    return collection.findOne({ email }).exec();
};
</code></pre>

<p>But either way I try when I print "profile.email" it is undefined and my result from</p>

<pre><code>io.emit('action', {
    type: PROFILE_LOGIN,
    email: profile.email,
    name: profile.name,
});
</code></pre>

<p>is:</p>

<pre><code>{
    type: PROFILE_LOGIN,
}
</code></pre>

<p>but if I do this: </p>

<pre><code>io.emit('action', {
    type: PROFILE_LOGIN,
    profile: profile,
});
</code></pre>

