<pre><code>{
    type: PROFILE_LOGIN,
    profile: {correct mongo document},
}
</code></pre>

<p>But I only need/want a few values from the mongo document.</p>

<p>Also, if there is a better way to rewrite "profileRoute()" (I know this question isn't really about that) using async-await I am open to suggestions.</p>

