<pre><code>{
    type: PROFILE_LOGIN,
    profile: [correct mongo document],
}
</code></pre>

<p>This more accurately reflects the return from ".findOne()": </p>

<pre><code>{
    type: PROFILE_LOGIN,
    profile: {correct mongo document},
}
</code></pre>

