<pre><code>if(filters.priceFilters.length) {
    for(let filter of filters.priceFilters) {
        productQuery.where('price').gte(+filter.low).lte(+filter.high);
    }
}     
</code></pre>

<p>The intention is to add a "where" clause for each price filter as shown in the data above. The problem is multiple where clauses for the price criteria are not being added. Each successive price filter in the for loop overwrites the last. So instead of having multiple "where" clauses for my price filters, the query only contains one for the last iteration of the for loop.</p>

