One mongoDB-instance, many DBs - how to connect a user to "their" DB without affecting other users?<p>I'm building an application (MVC) that will use 4 collections in a DB. When I add new clients to the application they will get their separate DB. So if I have 10 customers, there will be 10 DBs and 40 collections (1 db -> 4 collections)</p>

<p>This way each customer data is seperated from other customers, which is crucial here.</p>

<p>So far I've built the app and everything is working nicely, 'cept one thing. </p>

<p>If Company A logs in and start using the app everything works fine. But when Company A is logged in, and Company B logs in, both Company A AND B will be directed towards Company B:s DB. </p>

<p>I've looked trough my code and I guess this is my own fault because I use .connect (mongoose). When a company logs in the route will fire of a controller that will open a new connection (which overrides the old one) which will redirect all open connections towards that specific DB. </p>

<p><strong>controller.dBlogin.js</strong></p>

<pre><code>mongoose.connect(dbConfig.url + id, options)
    .then(() =&gt; {
        console.log("Successfully connected to the database");
        next();
    }).catch(err =&gt; {
        console.log('Could not connect to the database. Exiting now...');
        process.exit();
    });
</code></pre>

<p>The <strong>id</strong> is fetched from req.params.id (example: <a href="http://webapp.com/login/:id" rel="nofollow noreferrer">http://webapp.com/login/:id</a>). </p>

<p>As far as I've figured .connect only allows one connection at a given time so I need something that will, simply, allow many connections. So I'm thinking that I could use .createConnection for this,</p>

<ul>
<li><a href="https://mongoosejs.com/docs/connections.html#multiple_connections" rel="nofollow noreferrer">https://mongoosejs.com/docs/connections.html#multiple_connections</a></li>
</ul>

<p>But i just cant get it to work. </p>

<p>I changed <strong>controller.dBlogin.js</strong> to</p>

<pre><code>mongoose.createConnection(dbConfig.url + id, options)
    .then(() =&gt; {
        console.log("Successfully connected to the database");
        next();
    }).catch(err =&gt; {
        console.log('Could not connect to the database. Exiting now...');
        process.exit();
    });
</code></pre>

<p>but that only leads to a timeout when the company logs in. How do I use the .createConnections? How do you go from .connect to .createConnection? </p>

<p><strong>Heres the examples of routes, controller, and a model (user-schema).</strong></p>

<p><strong>routes.js</strong></p>

<pre><code>// connect to db, check auth
app.post('/login/:id', dbController.connectDB, dbController.login)
</code></pre>

<p><strong>controller.dbLogin.js</strong></p>

<pre><code>exports.**connectDB** = (req, res, next) =&gt; {

const id = req.params.id;

// Get Mongoose to use the global promise library
mongoose.Promise = global.Promise;

// Options Conncetion mongodb
const options = {
    useNewUrlParser: true,
};

// Connecting to the database
mongoose.connect(dbConfig.url + id, options)
    .then(() =&gt; {
        console.log("Successfully connected to the database");
        next();
    }).catch(err =&gt; {
        console.log('Could not connect to the database. Exiting now...');
        process.exit();
    });
};

exports.login = (req, res, next) =&gt; {

passport.authenticate('local-login', {
    successRedirect: '/start', // redirect to the secure profile section
    failureRedirect: '/login', // redirect back to the signup page if there is an error
    failureFlash: true // allow flash messages
})(req, res, next);
</code></pre>

<p>};</p>

<p>Example of a model <strong>user.js</strong></p>

<pre><code>const mongoose = require('mongoose');
const bcrypt   = require('bcrypt-nodejs');
const Company = require('../models/company.js');

// define the schema for our user model
const userSchema = mongoose.Schema({
local            : {
    name : {
        type: String, 
        required : true
    }, 

    email        : {
        type     : String,
        unique   : true,
        required : true
    },

    password     : String, 

    active       : Boolean,

    company      : {
        type: mongoose.Schema.Types.ObjectId,
        ref: 'Company'
    }
}
});

    // generating a hash for password
userSchema.methods.generateHash = function(password) {
return bcrypt.hashSync(password, bcrypt.genSaltSync(8), null);
};

// checking if password is valid
userSchema.methods.validPassword = function(password) {
return bcrypt.compareSync(password, this.local.password);
};

// create the model for users and expose it to our app
module.exports = mongoose.model('User', userSchema);
</code></pre>

